import React from 'react';
import './Dashboard.css';
import Button from '@mui/material/Button';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <>
      <div className='dashboard-container'>
        <div className='dashboard-bg'>
          <h1 className='dashboard-title'>BANKING & FINANCE MANAGEMENT SYSTEM</h1>
        </div>
        <div className="deposit-button-container">
          <Button
            component={Link}
            type="submit"
            fullWidth
            variant="contained"
            to='/Deposit'
            sx={{ width: '200px', height: '60px', backgroundColor: '#b388ff', color: '#000000', fontSize: '1.2rem' }}
          >
            Deposit
          </Button>
          <Button
            component={Link}
            type="submit"
            fullWidth
            variant="contained"
            to='/Profile'
            sx={{ width: '200px', height: '60px', backgroundColor: '#b388ff', color: '#000000', fontSize: '1.2rem', marginTop: '20px' }}
          >
            Profile
          </Button>
          <Button
            component={Link}
            type="submit"
            fullWidth
            variant="contained"
            to='/Dashboard'
            sx={{ width: '200px', height: '60px', backgroundColor: '#b388ff', color: '#000000', fontSize: '1.2rem', marginTop: '20px' }}
          >
            Dashboard
          </Button>
        </div>
      </div>
    </>
  );
};

export default Dashboard;
